import React, { Component } from "react";
class Body extends Component
{
    render()
    {
        return(
            <div>
                <h1>Welcome to waas</h1>
                <div>
                    <a href={"/log"}>Click to login</a>
                </div>
                <div>
                    <a href={"/register"}>Click to Register</a>
                </div>
            </div>
        )
    }
}
export default Body;
